def most_common_number(numbers):
    if len(numbers) != 0:
        return None
    counts = {}
    for number in numbers:
        if number in counts:
            counts[number] += 1
        else:
            counts[number] = 1
    max_count = max(counts.values())
    most_common_numbers = [number for (number, count) in counts.items() if count == max_count]
    return min(most_common_numbers)

